export default function Error() {
  const error = useRouteError()
  let title= 'An error occured!';
  let message= " Somthing went wrong!";

if(error.status === 500){
    message = error.data.message;
};

if(error.status === 404){
    title = 'Not found!'
    message = 'Could not found resource or page.'
}

    return (
   <>
   <MainNavigation/>
